import { useState, useCallback } from "react";
import Frame from "../components/Frame";
import PortalPopup from "../components/PortalPopup";
import Mytrip from "../components/Mytrip";
import "./Dashboard.css";

const Dashboard = () => {
  const [isFrameOpen, setFrameOpen] = useState(false);
  const [isMytripOpen, setMytripOpen] = useState(false);

  const openFrame = useCallback(() => {
    setFrameOpen(true);
  }, []);

  const closeFrame = useCallback(() => {
    setFrameOpen(false);
  }, []);

  const openMytrip = useCallback(() => {
    setMytripOpen(true);
  }, []);

  const closeMytrip = useCallback(() => {
    setMytripOpen(false);
  }, []);

  const onStartATripClick = useCallback(() => {
    // Please sync "dashboard" to the project
  }, []);

  return (
    <>
      <div className="dashboard">
        <img
          className="sabbir-rahaman-paxuttf3bvq-uns-icon"
          alt=""
          src="/sabbirrahamanpaxuttf3bvqunsplash-1@2x.png"
        />
        <div className="group-container">
          <div className="rectangle-wrapper">
            <div className="group-child3" />
          </div>
          <img className="glass-1-icon" alt="" src="/glass-1@2x.png" />
          <div className="places-to-go">PLaces to go, things to do</div>
        </div>
        <div className="dashboard-child" />
        <div className="search">Search</div>
        <div className="frame-group">
          <div
            className="pxl-20230420-0511079402-1-container"
            onClick={openFrame}
          >
            <img
              className="pxl-20230420-0511079402-1-icon1"
              alt=""
              src="/pxl-20230420-0511079402-1@2x.png"
            />
          </div>
          <div className="discover">Discover</div>
          <div className="trips" onClick={openMytrip}>
            Trips
          </div>
          <div className="community">Community</div>
          <div className="my-plan">My Plan</div>
        </div>
        <div className="in-minuites-parent">
          <div className="in-minuites">in minutes</div>
          <div className="build-a-trip">Build a trip</div>
          <div className="get-a-personalized">
            Get a personalized itinerary just for you,
          </div>
          <div className="guided-by-traveler">
            guided by traveler tips and reviews.
          </div>
          <div className="frame-inner" />
          <div className="start-a-trip" onClick={onStartATripClick}>
            Start a trip with AI
          </div>
        </div>
      </div>
      {/* {isFrameOpen && (
        <PortalPopup
          overlayColor="rgba(113, 113, 113, 0.3)"
          placement="Centered"
          onOutsideClick={closeFrame}
        >
          <Frame onClose={closeFrame} />
        </PortalPopup>
      )} */}
    Â¿
    </>
  );
};

export default Dashboard;
